import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import './App.css';
import AboutPage from './P-content/about/AboutPage';
import ContactPage from './P-content/contact/ContactPage';
import ProfilePage from './P-content/profile/ProfilePage';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          
        </header>
        <Route path="/about" component={AboutPage} />
        <Route path="/contact" component={ContactPage} />
        <Route path="/profile" component={ProfilePage} />
      </div>
    </BrowserRouter>
  );
}

export default App;
